$(document).ready(function(){$(".content img, #featured img").addClass("img-responsive");$(".content iframe, #featured iframe").addClass("embed-responsive-item iframe");$(window).on("load resize",function(){var h=$(window).height();var c=$(".navbar-static-top:first").height();var b=$(".bannerwrapper:first").height();var d=$(".searchlocations:first").height();var g=$(".searchpac:first").height();var a=$(".databases:first").height();var e=$(".footer:first").height();var f=h-c-b-d-g-a-e-300;if(f>0){$(".content:first").css({"min-height":f})}});$(window).scroll(function(){if($(this).scrollTop()>100){$(".scrollToTop").fadeIn()}else{$(".scrollToTop").fadeOut()}});$(".scrollToTop").click(function(){$("html, body").animate({scrollTop:0},500);return false});$('.carousel[data-type="multi"] .item').each(function(){var b=$(this).next();if(!b.length){b=$(this).siblings(":first")}b.children(":first-child").clone().appendTo($(this));for(var a=0;a<4;a++){b=b.next();if(!b.length){b=$(this).siblings(":first")}b.children(":first-child").clone().appendTo($(this))}$("#hottitlesCarousel.carousel").carousel("pause")})});window.onload=function(){var a=window.performance.timing.domContentLoadedEventEnd-window.performance.timing.navigationStart;console.log("Page load time is "+a);console.log(window.performance)};